import React from 'react'
export default class Container extends React.Component{
    constructor(props)
    {
        super(props)
        this.state={
            MessageFrom :'Default Message'
        }
    }

    render(){
        return <div>
                 <p>Top Level Container</p>
                     { this.state.MessageFrom}
               </div>
    };
}
